import React from 'react'
import styled from "styled-components"
import Search from './svg/Search';

const SearchBarDiv = styled.div`
    align-items: center;
    justify-content: center;
    display: flex;
`

const SearchBarInput = styled.input`
    width: 300px;
    height: 18px;
    font-size: 16px;
    border-radius: 10px;
    padding: 7px 10px;
    border: none;
    margin-right: 3px;
    font-family: 'Dosis', sans-serif;

    &:focus {
        outline: none;
    }
`


const Searchbar = () => {
  return (
    <SearchBarDiv>
        <SearchBarInput placeholder='Movies, TV Shows...'></SearchBarInput>
        <div>
            <Search/>
        </div>
    </SearchBarDiv>
  )
}

export default Searchbar
